(5, 83, 'aaa', 'aaa', '<p>aaaa</p>', '', -2, 9, '2019-10-19 22:03:39', 979, '', '2019-10-19 22:04:30', 979, 0, '0000-00-00 00:00:00', '2019-10-19 22:03:39', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"\",\"spfeatured_image_alt\":\"\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', 2, 0, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(6, 89, 'Mensagens aos pais', 'mensagens-aos-pais', '<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 24pt;\"><strong>Agradecimento aos pais</strong></span></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 24pt;\"><strong> </strong></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 14pt;\">Meus queridos pais, hoje é um dos dias mais importantes da minha vida. Hoje, eu cumpro mais uma missão, pois este é o dia da minha formatura e eu tenho muito ou tudo </span><span style=\"font-size: 14pt;\">a agradecer a vocês. Vocês vieram preparando o meu caminho, desde que eu nasci, para que esse dia enfim chegasse. Vocês se sacrificaram, se dedicaram, abdicaram de tempo e de muitos projetos pessoais para que eu tivesse a oportunidade de estudar e de ter uma boa formação profissional, mas também pessoal. </span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 14pt;\">Eu devo tudo que sou a vocês, e se sinto orgulho de mim e do lugar onde cheguei, é porque sei que vocês vieram segurando a minha mão. Hoje é o primeiro dia do resto da minha vida. E eu agradeço a vocês, como agradeço pela vida que me deram, e por serem os melhores pais do mundo. Eu dedico este título a vocês. </span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 14pt;\">Obrigada meu pai e minha mãe! Sem vocês, nada disso seria possível. Eu amo muito vocês!</span></p>', '', 1, 2, '2019-10-20 21:45:47', 979, '', '2019-10-20 22:09:17', 979, 0, '0000-00-00 00:00:00', '2019-10-20 21:45:47', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"\",\"spfeatured_image_alt\":\"\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', 8, 13, '', '', 1, 8, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(7, 90, 'Mensagens aos professores', 'mensagens-aos-professores', '<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 24pt;\"><strong>Agradecimento aos professores</strong></span></p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 14pt;\">Um bom professor deixa em cada um dos seus alunos uma marca indestrutível, um pedacinho do seu ‘eu’, da sua sabedoria, que não atrapalha, que muitas vezes não se consegue rastrear até ele, mas que está lá e cresce e evoluí com cada um dos alunos. Esse bom professor é você, e por isso mesmo chega esta inevitável melancolia por saber que você se vai aposentar. </span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 14pt;\">Obrigado por tudo, professor! A você, ao maravilhoso profissional e pessoa que você é e sempre foi, à sua infinita paciência, ao seu carisma, à sua sabedoria, muito obrigado. Esta é uma homenagem em forma de agradecimento que todos os que passaram pela sua vida profissional lhe quereriam prestar. </span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 14pt;\">Agora se abre uma nova etapa na sua vida, e ninguém mereceu mais este descanso do que você, mas ficará para sempre a saudade de um professor que jamais será possível substituir. </span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 14pt;\">Obrigado por tudo, professor!</span></p>', '', 1, 2, '2019-10-20 21:48:57', 979, '', '2019-10-20 21:48:57', 0, 0, '0000-00-00 00:00:00', '2019-10-20 21:48:57', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"\",\"spfeatured_image_alt\":\"\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', 1, 12, '', '', 1, 4, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(8, 91, 'Mensagens aos funcionários', 'mensagens-aos-funcionarios', '<div class=\"containerCozy-336-Cz container-206Blv\">\r\n<div class=\"markup-2BOw-j\"> </div>\r\n<div class=\"markup-2BOw-j\" style=\"text-align: center;\"><span style=\"font-size: 24pt;\"><strong>Agradecimentos aos funcionários</strong></span></div>\r\n<div class=\"markup-2BOw-j\" style=\"text-align: center;\"> </div>\r\n<div class=\"markup-2BOw-j\" style=\"text-align: justify;\"> </div>\r\n<div class=\"markup-2BOw-j\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\">Chegou a hora de olhar para trás e lembrar de todas as pessoas especiais que exercem papéis indispensáveis, tornando possível este momento. Eles trabalham em funções diversas, e no momento em que estamos recebendo aplausos, não podemos deixa de agradecer aos que ficaram atrás do palco possibilitando o nosso sucesso.</span></div>\r\n<div class=\"markup-2BOw-j\" style=\"text-align: justify;\"> </div>\r\n<div class=\"markup-2BOw-j\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\">As tarefas por eles realizadas muitas vezes passaram despercebidas, mas foram e são tão importantes quanto um professor em sala de aula. </span><span style=\"font-size: 14pt;\">Foram aqueles serviços acolhedores que nos deram a segurança de sermos bem-vindos ao local onde passamos tanto tempo. Mas a convivência nos tornou amigos e na partida levaremos saudades, deixando o nosso agradecimento pela dedicação de vocês, que viveram e dividiram todas as nossas angústias, frustrações e alegrias. </span></div>\r\n<div class=\"markup-2BOw-j\" style=\"text-align: justify;\"> </div>\r\n<div class=\"markup-2BOw-j\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\">Por tudo isso, o nosso simples mas eterno agradecimento aos funcionários que participaram direta ou indiretamente da nossa formação.</span></div>\r\n</div>', '', 1, 2, '2019-10-20 21:51:16', 979, '', '2019-10-20 22:08:12', 979, 0, '0000-00-00 00:00:00', '2019-10-20 21:51:16', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"\",\"spfeatured_image_alt\":\"\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', 3, 11, '', '', 1, 4, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(9, 92, 'Mensagens aos amigos', 'mensagens-aos-amigos', '<div class=\"containerCozy-336-Cz container-206Blv\">\r\n<div class=\"markup-2BOw-j\"> </div>\r\n<div class=\"markup-2BOw-j\" style=\"text-align: center;\"> </div>\r\n<div class=\"markup-2BOw-j\" style=\"text-align: center;\"><span style=\"font-size: 24pt;\"><strong>Agradecimento aos amigos</strong></span></div>\r\n<div class=\"markup-2BOw-j\" style=\"text-align: center;\"> </div>\r\n<div class=\"markup-2BOw-j\"> </div>\r\n<div class=\"markup-2BOw-j\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\">Foi ao lado de pessoas que jamais vou esquecer que passei os momentos mais especiais de toda minha vida. A celebração desta formatura jamais teria sido possível sem vocês, meus amigos e companheiros! Agradeço do fundo do meu coração por todas as coisas que me proporcionaram. </span></div>\r\n<div class=\"markup-2BOw-j\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\">Nem sempre foi fácil enfrentar os desafios mas partiu de vocês o incentivo para continuar lutando e não pensar em desistir. </span></div>\r\n<div class=\"markup-2BOw-j\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\">Vocês estiveram ao meu lado em todas as ocasiões. Acho que cresci de um jeito incrível desde a hora que a vida nos juntou. Só desejo que esta amizade continue forte independentemente das reviravoltas que a vida dê. </span></div>\r\n<div class=\"markup-2BOw-j\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\">Gosto muito de vocês!</span></div>\r\n</div>', '', 1, 2, '2019-10-20 22:00:06', 979, '', '2019-10-20 22:00:06', 0, 0, '0000-00-00 00:00:00', '2019-10-20 22:00:06', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"\",\"spfeatured_image_alt\":\"\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', 1, 10, '', '', 1, 1, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
