(17, 106, 'Lucas de Aguiar', 'lucas-de-aguiar', '<p> </p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Solteiro, brasileiro, 21 anos</span></p>\r\n</td>\r\n<td>\r\n<p>Rua Paraguaçu, nº 500A, Vila Cristina,</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p><span style=\"font-weight: 400;\"> </span></p>\r\n</td>\r\n<td> </td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Celular: (31) 99642-4959 </span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">E-mail: e.lucas73@gmail.com </span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p> </p>\r\n<p><b>OBJETIVO</b><b><br /></b><span style=\"font-weight: 400;\">Cargo desejado - Front-end, Back-end;  Pretensão salarial R$ 1000,00;<br /><br /></span></p>\r\n<p><b>FORMAÇÃO ACADÊMICA</b></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Cursando Sistemas de Informação pela Pontifícia Universidade Católica de Minas Gerais (PUC-MG), desde 2017.</span><span style=\"font-weight: 400;\"><br /><br /></span></li>\r\n</ul>\r\n<p><b>CURSOS COMPLEMENTARES</b><b><br /></b><b><br /></b><span style=\"font-weight: 400;\">Curso Técnico em Informática, CEFET-MG em Minas Gerais 01/2014 - 12/2016.</span><span style=\"font-weight: 400;\"><br /><br /></span></p>\r\n<p><b>INFORMAÇÕES ADICIONAIS</b></p>\r\n<p><b>- Trabalhos de Pesquisa </b></p>\r\n<p>CEFET-MG - 2015<b> </b><span style=\"font-size: 12.16px;\">Atividades desenvolvidas: Utilização do software de geoprocessamento ARCGIS para mapeamento dos parques ambientais do município de Contagem-MG.</span></p>\r\n<p><strong>EXPERIÊNCIAS PROFISSIONAIS </strong></p>\r\n<p>Desenvolvedor, SKY SYSTEM MONITORAMENTO LTDA em Minas Gerais, Belo Horizonte - MG. Período: 09/2018 - 07/2019 Cargo: Desenvolvedor (Estagiário) Desenvolvimento utilizando Groovy/grails, Java, JavaScript e SGBD Postgresql.</p>\r\n<p> Estagiário de Documentação, Avanço Informática Ltda em Minas Gerais, Belo Horizonte - MG. Período: 06/2017 - 09/2018 Cargo: Suporte Técnico (Estagiário) Responsável por administrar a base de conhecimento para o cliente, oferecendo documentações sobre o sistema. Além disso, realizar atividades esporádicas de desenvolvimento e administração do banco de dados<b><br /><br /></b></p>\r\n<p><b>IDIOMAS</b></p>\r\n<p> Inglês - Leitura: Básico | Escrita: Básico| Fala: Básico;</p>\r\n<p> Espanhol - Leitura: Básico | Escrita: Básico| Fala: Básico;</p>', '', 1, 2, '2019-10-20 22:57:01', 979, '', '2019-10-21 00:12:15', 979, 0, '0000-00-00 00:00:00', '2019-10-20 22:57:01', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"\",\"spfeatured_image_alt\":\"\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', 2, 2, '', '', 1, 0, '{\