(18, 107, 'Rhuan Henriique', 'rhuan-henriique', '<p>Rhuan Henrique C. A. das D. Araújo ____________________________________________________________________________</p>\r\n<p>Brasileiro, 24 anos. CNH: B Endereço residencial: Rua jornalista Paulo Muzzi, nº 88, Betim. Contatos: (31) 97319-3272 / (31) 3593-8912 e-mail: <a href=\"mailto:rhuanhenriquefs@gmail.com\">rhuanhenriquefs@gmail.com</a> ____________________________________________________________________________</p>\r\n<p>Formação Acadêmica</p>\r\n<p>2011 Ensino Médio E.E. Conselheiro Afonso Pena.</p>\r\n<p>2012 Processos Administrativos Serviço Nacional de Aprendizagem Industrial (SENAI) ]</p>\r\n<p>2012 Informática Básica e Web Design MEGA</p>\r\n<p>Cursos 2013 – 2015 Técnico em Informática Faculdade Pitágoras (PRONATEC)</p>\r\n<p>2014 Instalação e Manutenção de Microcomputadores. Serviço Nacional de Aprendizagem Industrial (SENAI)</p>\r\n<p>2014 Instalação e Manutenção de Redes de Computadores. Serviço Nacional de Aprendizagem Industrial (SENAI)</p>\r\n<p>2017 – 2020 Sistemas de Informação. (6º Período) Pontifícia Universidade Católica de Minas Gerais (PUC Minas) ____________________________________________________________________________</p>\r\n<p>Formação Complementar</p>\r\n<p>2014 Redes de Computadores Fundação Bradesco (Escola Virtual)</p>\r\n<p>2014 Segurança da Informação Fundação Bradesco (Escola Virtual)</p>\r\n<p>2019 HTML, CSS e JavaScript (Intermediário) Udemy</p>\r\n<p>2019 Banco de dados e SQL Udemy ____________________________________________________________________________</p>\r\n<p>Experiência profissionais</p>\r\n<p>1. FRIGOBET – Aux. de Informática. Manutenção de microcomputadores e redes locais. Auxílio à funcionários com questões sobre informática.</p>\r\n<p>2. ENGESP – Aux. de Informática. Manutenção de microcomputadores e redes locais.</p>\r\n<p>3. METAL SILDER – Aux. de Administração e RH. Organização de arquivos, gerência de informações, revisão de documentos entre outras atividades.</p>\r\n<p>4. CSU CARDSYSTEM – Suporte T.I. Gerenciamento de usuários no Active Directory(2003 e 2012) e Exchange, especificação de Produtos para compra, gerenciamento de inventário, manutenção e instalação de microcomputadores, auxílio a funcionários com questões relacionadas a informática, gerenciamento de licenças, entre outros.</p>\r\n<p>5. Prefeitura de Betim – Suporte a ERP. Suporte ao sistema ERP usado pela Prefeitura de Betim</p>', '', 1, 2, '2019-10-20 22:57:51', 979, '', '2019-10-21 23:51:02', 979, 0, '0000-00-00 00:00:00', '2019-10-20 22:57:51', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"\",\"spfeatured_image_alt\":\"\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', 2, 1, '', '', 1, 0, '{\"r