":\\\"\\\",\\\"show_urls_images_backend\\\":\\\"\\\",\\\"show_urls_images_frontend\\\":\\\"\\\",\\\"spfeatured_image\\\":\\\"\\\",\\\"spfeatured_image_alt\\\":\\\"\\\",\\\"post_format\\\":\\\"standard\\\",\\\"gallery\\\":\\\"\\\",\\\"audio\\\":\\\"\\\",\\\"video\\\":\\\"\\\",\\\"link_title\\\":\\\"\\\",\\\"link_url\\\":\\\"\\\",\\\"quote_text\\\":\\\"\\\",\\\"quote_author\\\":\\\"\\\",\\\"post_status\\\":\\\"\\\"}\",\"version\":2,\"ordering\":\"0\",\"metakey\":\"\",\"metadesc\":\"\",\"access\":\"1\",\"hits\":\"0\",\"metadata\":\"{\\\"robots\\\":\\\"\\\",\\\"author\\\":\\\"\\\",\\\"rights\\\":\\\"\\\",\\\"xreference\\\":\\\"\\\"}\",\"featured\":\"0\",\"language\":\"*\",\"xreference\":\"\",\"note\":\"\"}', 0),
(12, 6, 1, '', '2019-10-20 21:45:47', 979, 3334, '405788a5083a2160761a3eb87a963e955f2f38f9', '{\"id\":\"6\",\"asset_id\":89,\"title\":\"Mensagens aos pais\",\"alias\":\"mensagens-aos-pais\",\"introtext\":\"<p style=\\\"text-align: center;\\\"><span style=\\\"font-size: 24pt;\\\"><strong>Agradecimento aos pais pela formatura<\\/strong> <\\/span><\\/p>\\r\\n<p style=\\\"text-align: center;\\\">\\u00a0<\\/p>\\r\\n<p><span style=\\\"font-size: 14pt;\\\">Meus queridos pais, hoje \\u00e9 um dos dias mais importantes da minha vida. Hoje, eu cumpro mais uma miss\\u00e3o, pois este \\u00e9 o dia da minha formatura e eu tenho muito ou tudo a agradecer a voc\\u00eas. Voc\\u00eas vieram preparando o meu caminho, desde que eu nasci, para que esse dia enfim chegasse. Voc\\u00eas se sacrificaram, se dedicaram, abdicaram de tempo e de muitos projetos pessoais para que eu tivesse a oportunidade de estudar e de ter uma boa forma\\u00e7\\u00e3o profissional, mas tamb\\u00e9m pessoal. <\\/span><\\/p>\\r\\n<p><span style=\\\"font-size: 14pt;\\\">Eu devo tudo que sou a voc\\u00eas, e se sinto orgulho de mim e do lugar onde cheguei, \\u00e9 porque sei que voc\\u00eas vieram segurando a minha m\\u00e3o. Hoje \\u00e9 o primeiro dia do resto da minha vida. E eu agrade\\u00e7o a voc\\u00eas, como agrade\\u00e7o pela vida que me deram, e por serem os melhores pais do mundo. Eu dedico este t\\u00edtulo a voc\\u00eas. <\\/span><\\/p>\\r\\n<p><span style=\\\"font-size: 14pt;\\\">Obrigada meu pai e minha m\\u00e3e! Sem voc\\u00eas, nada disso seria poss\\u00edvel. Eu amo muito voc\\u00eas!<\\/span><\\/p>\",\"fulltext\":\"\",\"state\":1,\"catid\":\"2\",\"created\":\"2019-10-20 21:45:47\",\"created_by\":\"979\",\"created_by_alias\":\"\",\"modified\":\"2019-10-20 21:45:47\",\"modified_by\":null,\"checked_out\":null,\"checked_out_time\":null,\"publish_up\":\"2019-10-20 21:45:47\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":false,\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"info_block_show_title\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_associations\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_create_date\\\":\\\"\\\",\\\"show_modify_date\\\":\\\"\\\",\\\"show_publish_date\\\":\\\"\\\",\\\"show_item_navigation\\\":\\\"\\\",\\\"show_icons\\\":\\\"\\\",\\\"show_print_icon\\\":\\\"\\\",\\\"show_email_icon\\\":\\\"\\\",\\\"show_vote\\\":\\\"\\\",\\\"show_hits\\\":\\\"\\\",\\\"show_noauth\\\":\\\"\\\",\\\"urls_position\\\":\\\"\\\",\\\"alternative_readmore\\\":\\\"\\\",\\\"article_page_title\\\":\\\"\\\",\\\"show_publishing_options\\\":\\\"\\\",\\\"show_article_options\\\":\\\"\\\",\\\"show_urls_images_backend\\\":\\\"\\\",\\\"show_urls_images_frontend\\\":\\\"\\\",\\\"spfeatured_image\\\":\\\"\\\",\\\"spfeatured_image_alt\\\":\\\"\\\",\\\"post_format\\\":\\\"standard\\\",\\\"gallery\\\":\\\"\\\",\\\"audio\\\":\\\"\\\",\\\"video\\\":\\\"\\\",\\\"link_title\\\":\\\"\\\",\\\"link_url\\\":\\\"\\\",\\\"quote_text\\\":\\\"\\\",\\\"quote_author\\\":\\\"\\\",\\\"post_status\\\":\\\"\\\"}\",\"version\":1,\"ordering\":null,\"metakey\":\"\",\"metadesc\":\"\",\"access\":\"1\",\"hits\":null,\"metadata\":\"{\\\"robots\\\":\\\"\\\",\\\"author\\\":\\\"\\\",\\\"rights\\\":\\\"\\\",\\\"xreference\\\":\\\"\\\"}\",\"featured\":\"0\",\"language\":\"*\",\"xreference\":\"\",\"note\":\"\"}', 0),
(13, 7, 1, '', '2019-10-20 21:48:57', 979, 3540, '2e4c8494a27f688ad4574a50994227cfe4fcbf28', '{\"id\":\"7\",\"asset_id\":90,\"title\":\"Mensagens aos professores\",\"alias\":\"mensagens-aos-professores\",\"introtext\":\"<p style=\\\"text-align: center;\\\">\\u00a0<\\/p>\\r\\n<p style=\\\"text-align: center;\\\"><span style=\\\"font-size: 24pt;\\\"><strong>Agradecimento aos professores<\\/strong><\\/span><\\/p>\\r\\n<p>\\u00a0<\\/p>\\r\\n<p style=\\\"text-align: justify;\\\"><span style=\\\"font-size: 14pt;\\\">Um bom professor deixa em cada um dos seus alunos uma marca indestrut\\u00edvel, um pedacinho do seu \\u2018eu\\u2019, da sua sabedoria, que n\\u00e3o atrapalha, que muitas vezes n\\u00e3o se consegue rastrear at\\u00e9 ele, mas que est\\u00e1 l\\u00e1 e cresce e evolu\\u00ed com cada um dos alunos. Esse bom professor \\u00e9 voc\\u00ea, e por isso mesmo chega esta inevit\\u00e1vel melancolia por saber que voc\\u00ea se vai aposentar. <\\/span><\\/p>\\r\\n<p style=\\\"text-align: justify;\\\"><span style=\\\"font-size: 14pt;\\\">Obrigado por tudo, professor! A voc\\u00ea, ao maravilhoso profissional e pessoa que voc\\u00ea \\u00e9 e sempre foi, \\u00e0 sua infinita paci\\u00eancia, ao seu carisma, \\u00e0 sua sabedoria, muito obrigado. Esta \\u00e9 uma homenagem em forma de agradecimento que todos os que passaram pela sua vida profissional lhe quereriam prestar. <\\/span><\\/p>\\r\\n<p style=\\\"text-align: justify;\\\"><span style=\\\"font-size: 14pt;\\\">Agora se abre uma nova etapa na sua vida, e ningu\\u00e9m mereceu mais este descanso do que voc\\u00ea, mas ficar\\u00e1 para sempre a saudade de um professor que jamais ser\\u00e1 poss\\u00edvel substituir. <\\/span><\\/p>\\r\\n<p style=\\\"text-align: justify;\\\"><span style=\\\"font-size: 14pt;\\\">Obrigado por tudo, professor!<\\/span><\\/p>\",\"fulltext\":\"\",\"state\":1,\"catid\":\"2\",\"created\":\"2019-10-20 21:48:57\",\"created_by\":\"979\",\"created_by_alias\":\"\",\"modified\":\"2019-10-20 21:48:57\",\"modified_by\":null,\"checked_out\":null,\"checked_out_time\":null,\"publish_up\":\"2019-10-20 21:48:57\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":false,\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"info_block_show_title\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_associations\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_create_date\\\":\\\"\\\",\\\"show_modify_date\\\":\\\"\\\",\\\"show_publish_date\\\":\\\"\\\",\\\"show_item_navigation\\\":\\\"\\\",\\\"show_icons\\\":\\\"\\\",\\\"show_print_icon\\\":\\\"\\\",\\\"show_email_icon\\\":\\\"\\\",\\\"show_vote\\\":\\\"\\\",\\\"show_hits\\\":\\\"\\\",\\\"show_noauth\\\":\\\"\\\",\\\"urls_position\\\":\\\"\\\",\\\"alternative_readmore\\\":\\\"\\\",\\\"article_page_title\\\":\\\"\\\",\\\"show_publishing_options\\\":\\\"\\\",\\\"show_article_options\\\":\\\"\\\",\\\"show_urls_images_backend\\\":\\\"\\\",\\\"show_urls_images_frontend\\\":\\\"\\\",\\\"spfeatured_image\\\":\\\"\\\",\\\"spfeatured_image_alt\\\":\\\"\\\",\\\"post_format\\\":\\\"standard\\\",\\\"gallery\\\":\\\"\\\",\\\"audio\\\":\\\"\\\",\\\"video\\\":\\\"\\\",\\\"link_title\\\":\\\"\\\",\\\"link_url\\\":\\\"\\\",\\\"quote_text\\\":\\\"\\\",\\\"quote_author\\\":\\\"\\\",\\\"post_status\\\":\\\"\\\"}\",\"version\":1,\"ordering\":null,\"metakey\":\"\",\"metadesc\":\"\",\"access\":\"1\",\"hits\":null,\"metadata\":\"{\\\"robots\\\":\\\"\\\",\\\"author\\\":\\\"\\\",\\\"rights\\\":\\\"\\\",\\\"xreference\\\":\\\"\\\"}\",\"featured\":\"0\",\"language\":\"*\",\"xreference\":\"\",\"note\":\"\"}', 0),
(14, 8, 1, '', '2019-10-20 21:51:16', 979, 3815, '13fcdfeec07633a78202a56bbef691b060af3cc7', '{\"id\":\"8\",\"asset_id\":91,\"title\":\"Mensagens aos funcion\\u00e1rios\",\"alias\":\"mensagens-aos-funcionarios\",\"introtext\":\"<div class=\\\"containerCozy-336-Cz container-206Blv\\\">\\r\\n<div class=\\\"markup-2BOw-j\\\">\\u00a0<\\/div>\\r\\n<div class=\\\"markup-2BOw-j\\\" style=\\\"text-align: center;\\\"><span style=\\\"font-size: 24pt;\\\"><strong>Agradecimentos aos funcion\\u00e1rios<\\/strong><\\/span><\\/div>\\r\\n<div class=\\\"markup-2BOw-j\\\" style=\\\"text-align: center;\\\">\\u00a0<\\/div>\\r\\n<div class=\\\"markup-2BOw-j\\\">\\u00a0<\\/div>\\r\\n<div class=\\\"markup-2BOw-j\\\"><span style=\\\"font-size: 14pt;\\\">Chegou a hora de olhar para tr\\u00e1s e lembrar de todas as pessoas especiais que exercem pap\\u00e9is indispens\\u00e1veis, tornando poss\\u00edvel este momento. Eles trabalham em fun\\u00e7\\u00f5es diversas, e no momento em que estamos recebendo aplausos, n\\u00e3o podemos deixa de agradecer aos que ficaram atr\\u00e1s do palco possibilitando o nosso sucesso.<\\/span><\\/div>\\r\\n<div class=\\\"markup-2BOw-j\\\">\\u00a0<\\/div>\\r\\n<div class=\\\"markup-2BOw-j\\\"><span style=\\\"font-size: 14pt;\\\">As tarefas por eles realizadas muitas vezes passaram despercebidas, mas foram e s\\u00e3o t\\u00e3o importantes quanto um professor em sala de aula. <\\/span><span style=\\\"font-size: 14pt;\\\">Foram aqueles servi\\u00e7os acolhedores que nos deram a seguran\\u00e7a de sermos bem-vindos ao local onde passamos tanto tempo. Mas a conviv\\u00eancia nos tornou amigos e na partida levaremos saudades, deixando o nosso agradecimento pela dedica\\u00e7\\u00e3o de voc\\u00eas, que viveram e dividiram todas as nossas ang\\u00fastias, frustra\\u00e7\\u00f5es e alegrias. <\\/span><\\/div>\\r\\n<div class=\\\"markup-2BOw-j\\\">\\u00a0<\\/div>\\r\\n<div class=\\\"markup-2BOw-j\\\"><span style=\\\"font-size: 14pt;\\\">Por tudo isso, o nosso simples mas eterno agradecimento aos funcion\\u00e1rios que participaram direta ou indiretamente da nossa forma\\u00e7\\u00e3o.<\\/span><\\/div>\\r\\n<\\/div>\",\"fulltext\":\"\",\"state\":1,\"catid\":\"2\",\"created\":\"2019-10-20 21:51:16\",\"created_by\":\"979\",\"created_by_alias\":\"\",\"modified\":\"2019-10-20 21:51:16\",\"modified_by\":null,\"checked_out\":null,\"checked_out_time\":null,\"publish_up\":\"2019-10-20 21:51:16\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":false,\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"info_block_show_title\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_associations\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_create_date\\\":\\\"\\\",\\\"show_modify_date\\\":\\\"\\\",\\\"show_publish_date\\\":\\\"\\\",\\\"show_item_navigation\\\":\\\"\\\",\\\"show_icons\\\":\\\"\\\",\\\"show_print_icon\\\":\\\"\\\",\\\"show_email_icon\\\":\\\"\\\",\\\"show_vote\\\":\\\"\\\",\\\"show_hits\\\":\\\"\\\",\\\"show_noauth\\\":\\\"\\\",\\\"urls_position\\\":\\\"\\\",\\\"alternative_readmore\\\":\\\"\\\",\\\"article_page_title\\\":\\\"\\\",\\\"show_publishing_options\\\":\\\"\\\",\\\"show_article_options\\\":\\\"\\\",\\\"show_urls_images_backend\\\":\\\"\\\",\\\"show_urls_