(16, 9, 1, '', '2019-10-20 22:00:06', 979, 3636, 'e2b2ecee71e4c60d1359bd1bc3d8bdf5b1856bd8', '{\"id\":\"9\",\"asset_id\":92,\"title\":\"Mensagens aos amigos\",\"alias\":\"mensagens-aos-amigos\",\"introtext\":\"<div class=\\\"containerCozy-336-Cz container-206Blv\\\">\\r\\n<div class=\\\"markup-2BOw-j\\\">\\u00a0<\\/div>\\r\\n<div class=\\\"markup-2BOw-j\\\" style=\\\"text-align: center;\\\">\\u00a0<\\/div>\\r\\n<div class=\\\"markup-2BOw-j\\\" style=\\\"text-align: center;\\\"><span style=\\\"font-size: 24pt;\\\"><strong>Agradecimento aos amigos<\\/strong><\\/span><\\/div>\\r\\n<div class=\\\"markup-2BOw-j\\\" style=\\\"text-align: center;\\\">\\u00a0<\\/div>\\r\\n<div class=\\\"markup-2BOw-j\\\">\\u00a0<\\/div>\\r\\n<div class=\\\"markup-2BOw-j\\\" style=\\\"text-align: justify;\\\"><span style=\\\"font-size: 14pt;\\\">Foi ao lado de pessoas que jamais vou esquecer que passei os momentos mais especiais de toda minha vida. A celebra\\u00e7\\u00e3o desta formatura jamais teria sido poss\\u00edvel sem voc\\u00eas, meus amigos e companheiros! Agrade\\u00e7o do fundo do meu cora\\u00e7\\u00e3o por todas as coisas que me proporcionaram. <\\/span><\\/div>\\r\\n<div class=\\\"markup-2BOw-j\\\" style=\\\"text-align: justify;\\\"><span style=\\\"font-size: 14pt;\\\">Nem sempre foi f\\u00e1cil enfrentar os desafios mas partiu de voc\\u00eas o incentivo para continuar lutando e n\\u00e3o pensar em desistir. <\\/span><\\/div>\\r\\n<div class=\\\"markup-2BOw-j\\\" style=\\\"text-align: justify;\\\"><span style=\\\"font-size: 14pt;\\\">Voc\\u00eas estiveram ao meu lado em todas as ocasi\\u00f5es. Acho que cresci de um jeito incr\\u00edvel desde a hora que a vida nos juntou. S\\u00f3 desejo que esta amizade continue forte independentemente das reviravoltas que a vida d\\u00ea. <\\/span><\\/div>\\r\\n<div class=\\\"markup-2BOw-j\\\" style=\\\"text-align: justify;\\\"><span style=\\\"font-size: 14pt;\\\">Gosto muito de voc\\u00eas!<\\/span><\\/div>\\r\\n<\\/div>\",\"fulltext\":\"\",\"state\":1,\"catid\":\"2\",\"created\":\"2019-10-20 22:00:06\",\"created_by\":\"979\",\"created_by_alias\":\"\",\"modified\":\"2019-10-20 22:00:06\",\"modified_by\":null,\"checked_out\":null,\"checked_out_time\":null,\"publish_up\":\"2019-10-20 22:00:06\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":false,\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"info_block_show_title\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_associations\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_create_date\\\":\\\"\\\",\\\"show_modify_date\\\":\\\"\\\",\\\"show_publish_date\\\":\\\"\\\",\\\"show_item_navigation\\\":\\\"\\\",\\\"show_icons\\\":\\\"\\\",\\\"show_print_icon\\\":\\\"\\\",\\\"show_email_icon\\\":\\\"\\\",\\\"show_vote\\\":\\\"\\\",\\\"show_hits\\\":\\\"\\\",\\\"show_noauth\\\":\\\"\\\",\\\"urls_position\\\":\\\"\\\",\\\"alternative_readmore\\\":\\\"\\\",\\\"article_page_title\\\":\\\"\\\",\\\"show_publishing_options\\\":\\\"\\\",\\\"show_article_options\\\":\\\"\\\",\\\"show_urls_images_backend\\\":\\\"\\\",\\\"show_urls_images_frontend\\\":\\\"\\\",\\\"spfeatured_image\\\":\\\"\\\",\\\"spfeatured_image_alt\\\":\\\"\\\",\\\"post_format\\\":\\\"standard\\\",\\\"gallery\\\":\\\"\\\",\\\"a