(24, 6, 1, '', '2019-10-20 22:06:38', 979, 3418, 'c8b046a875710829285b754d5d39c469448245d5', '{\"id\":6,\"asset_id\":\"89\",\"title\":\"Mensagens aos pais\",\"alias\":\"mensagens-aos-pais\",\"introtext\":\"<p style=\\\"text-align: center;\\\">\\u00a0<\\/p>\\r\\n<p style=\\\"text-align: center;\\\"><span style=\\\"font-size: 24pt;\\\"><strong>Agradecimento aos pais\\u00a0<\\/strong><\\/span><\\/p>\\r\\n<p style=\\\"text-align: center;\\\">\\u00a0<span style=\\\"font-size: 14pt;\\\">Meus queridos pais, hoje \\u00e9 um dos dias mais importantes da minha vida. Hoje, eu cumpro mais uma miss\\u00e3o, pois este \\u00e9 o dia da minha formatura e eu tenho muito ou tudo <\\/span><span style=\\\"font-size: 14pt;\\\">a agradecer a voc\\u00eas. Voc\\u00eas vieram preparando o meu caminho, desde que eu nasci, para que esse dia enfim chegasse. Voc\\u00eas se sacrificaram, se dedicaram, abdicaram de tempo e de muitos projetos pessoais para que eu tivesse a oportunidade de estudar e de ter uma boa forma\\u00e7\\u00e3o profissional, mas tamb\\u00e9m pessoal. <\\/span><\\/p>\\r\\n<p><span style=\\\"font-size: 14pt;\\\">Eu devo tudo que sou a voc\\u00eas, e se sinto orgulho de mim e do lugar onde cheguei, \\u00e9 porque sei que voc\\u00eas vieram segurando a minha m\\u00e3o. Hoje \\u00e9 o primeiro dia do resto da minha vida. E eu agrade\\u00e7o a voc\\u00eas, como agrade\\u00e7o pela vida que me deram, e por serem os melhores pais do mundo. Eu dedico este t\\u00edtulo a voc\\u00eas. <\\/span><\\/p>\\r\\n<p><span style=\\\"font-size: 14pt;\\\">Obrigada meu pai e minha m\\u00e3e! Sem voc\\u00eas, nada disso seria poss\\u00edvel. Eu amo muito voc\\u00eas!<\\/span><\\/p>\",\"fulltext\":\"\",\"state\":1,\"catid\":\"2\",\"created\":\"2019-10-20 21:45:47\",\"created_by\":\"979\",\"created_by_alias\":\"\",\"modified\":\"2019-10-20 22:06:38\",\"modified_by\":\"979\",\"checked_out\":\"979\",\"checked_out_time\":\"2019-10-20 22:06:27\",\"publish_up\":\"2019-10-20 21:45:47\",\"publish_down\":\"0