(27, 8, 1, '', '2019-10-20 22:08:12', 979, 4018, 'e3316ddff11f327a901ca702411d0f5b30e7fc4d', '{\"id\":8,\"asset_id\":\"91\",\"title\":\"Mensagens aos funcion\\u00e1rios\",\"alias\":\"mensagens-aos-funcionarios\",\"introtext\":\"<div class=\\\"containerCozy-336-Cz container-206Blv\\\">\\r\\n<div class=\\\"markup-2BOw-j\\\">\\u00a0<\\/div>\\r\\n<div class=\\\"markup-2BOw-j\\\" style=\\\"text-align: center;\\\"><span style=\\\"font-size: 24pt;\\\"><strong>Agradecimentos aos funcion\\u00e1rios<\\/strong><\\/span><\\/div>\\r\\n<div class=\\\"markup-2BOw-j\\\" style=\\\"text-align: center;\\\">\\u00a0<\\/div>\\r\\n<div class=\\\"markup-2BOw-j\\\" style=\\\"text-align: justify;\\\">\\u00a0<\\/div>\\r\\n<div class=\\\"markup-2BOw-j\\\" style=\\\"text-align: justify;\\\"><span style=\\\"font-size: 14pt;\\\">Chegou a hora de olhar para tr\\u00e1s e lembrar de todas as pessoas especiais que exercem pap\\u00e9is indispens\\u00e1veis, tornando poss\\u00edvel este momento. Eles trabalham em fun\\u00e7\\u00f5es diversas, e no momento em que estamos recebendo aplausos, n\\u00e3o podemos deixa de agradecer aos que ficaram atr\\u00e1s do palco possibilitando o nosso sucesso.<\\/span><\\/div>\\r\\n<div class=\\\"markup-2BOw-j\\\" style=\\\"text-align: justify;\\\">\\u00a0<\\/div>\\r\\n<div class=\\\"markup-2BOw-j\\\" style=\\\"text-align: justify;\\\"><span style=\\\"font-size: 14pt;\\\">As tarefas por eles realizadas muitas vezes passaram despercebidas, mas foram e s\\u00e3o t\\u00e3o importantes quanto um professor em sala de aula. <\\/span><span style=\\\"font-size: 14pt;\\\">Foram aqueles servi\\u00e7os acolhedores que nos deram a seguran\\u00e7a de sermos bem-vindos ao local onde passamos tanto tempo. Mas a conviv\\u00eancia nos tornou amigos e na partida levaremos saudades, deixando o nosso agradecimento pela dedica\\u00e7\\u00e3o de voc\\u00eas, que viveram e dividiram todas as nossas ang\\u00fastias, frustra\\u00e7\\u00f5es e alegrias. <\\/span><\\/div>\\r\\n<div class=\\\"markup-2BOw-j\\\" style=\\\"text-align: justify;\\\">\\u00a0<\\/div>\\r\\n<div class=\\\"markup-2BOw-j\\\" style=\\\"text-align: justify;\\\"><span style=\\\"font-size: 14pt;\\\">Por tudo isso, o nosso simples mas eterno agradecimento aos funcion\\u00e1rios que participaram direta ou indiretamente da nossa forma\\u00e7\\u00e3o.<\\/span><\\/div>\\r\\n<\\/div>\",\"fulltext\":\"\",\"state\":1,\"catid\":\"2\",\"created\":\"2019-10-20 21:51:16\",\"created_by\":\"979\",\"created_by_alias\":\"\",\"modified\":\"2019-10-20 22:08:12\",\"modified_by\":\"979\",\"checked_out\":\"979\",\"checked_out_time\":\"2019-10-20 22:07:57\",\"publish_up\":\"2019-10-20 21:51:16\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":false,\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"info_block_show_title\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_associations\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_create_date\\\":\\\"\\\",\\\"show_modify_date\\\":\\\"\\\",\\\"show_publish_date\\\":\\\"\\\",\\\"show_item_navigation\\\":\\\"\\\",\\\"show_icons\\\":\\\"\\\",\\\"show_print_icon\\\":\\\"\\\",\\\"show_email_icon\\\":\\\"\\\",\\\"show_vote\\\":\\\"\\\",\\\"show_hits\\\":\\\"\\\",\\\"show_noauth\\\":\\\"\\\",\\\"urls_position\\\":\\\"\\\",\\\"alternative_readmore\\\":\\\"\\\",\\\"article_page_title\\\":\\\"\\\",\\\"show_publishing_options\\\":\\\"\\\",\\\"show_article_options\\\":\\\"\\\",\\\"show_urls_images_backend\\\":\\\"\\\",\\\"show_urls_images_frontend\\\":\\\"\\\",\\\"spfeatured_image\\\":\\\"\\\",\\\"spfeatured_image_alt\\\":\\\"\\\",\\\"post_format\\\":\\\"standard\\\",\\\"gallery\\\":\\\"\\\",\\\"audio\\\":\\\"\\\",\\\"video\\\":\\\"\\\",\\\"link_title\\\":\\\"\\\",\\\"link_url\\\":\\\"\\\",\\\"quote_text\\\":\\\"\\\",\\\"quote_author\\\":\\\"\\\",\\\"post_status\\\":\\\"\\\"}\",\"version\":3,\"ordering\":\"1\",\"metakey\":\"\",\"metadesc\":\"\",\"access\":\"1\",\"hits\":\"3\",\"metadata\":\"{\\\"robots\\\":\\\"\\\",\\\"author\\\":\\\"\\\",\\\"rights\\\":\\\"\\\",\\\"xreference\\\":\\\"\\\"}\",\"featured\":\"0\",\"language\":\"*\",\"xreference\":\"\",\"note\":\"\"}', 0),
(28, 6, 1, '', '2019-10-20 22:08:52', 979, 3528, '8bcefd91a8e90b6530a3d54dc3729986018a9c15', '{\"id\":6,\"asset_id\":\"89\",\"title\":\"Mensagens aos pais\",\"alias\":\"mensagens-aos-pais\",\"introtext\":\"<p style=\\\"text-align: center;\\\"><span style=\\\"font-size: 24pt;\\\"><strong>Agradecimento aos pais<\\/strong><\\/span><\\/p>\\r\\n<p style=\\\"text-align: center;\\\"><span style=\\\"font-size: 24pt;\\\"><strong>\\u00a0<\\/strong><\\/span><\\/p>\\r\\n<p style=\\\"text-align: justify;\\\"><span style=\\\"font-size: 14pt;\\\">Meus queridos pais, hoje \\u00e9 um dos dias mais importantes da minha vida. Hoje, eu cumpro mais uma miss\\u00e3o, pois este \\u00e9 o dia da minha formatura e eu tenho muito ou tudo <\\/span><span style=\\\"font-size: 14pt;\\\">a agradecer a voc\\u00eas. Voc\\u00eas vieram preparando o meu caminho, desde que eu nasci, para que esse dia enfim chegasse. Voc\\u00eas se sacrificaram, se dedicaram, abdicaram de tempo e de muitos projetos pessoais para que eu tivesse a oportunidade de estudar e de ter uma boa forma\\u00e7\\u00e3o profissional, mas tamb\\u00e9m pessoal. <\\/span><\\/p>\\r\\n<p style=\\\"text-align: justify;\\\"><span style=\\\"font-size: 14pt;\\\">Eu devo tudo que sou a voc\\u00eas, e se sinto orgulho de mim e do lugar onde cheguei, \\u00e9 porque sei que voc\\u00eas vieram segurando a minha m\\u00e3o. Hoje \\u00e9 o primeiro dia do resto da minha vida. E eu agrade\\u00e7o a voc\\u00eas, como agrade\\u00e7o pela vida que me deram, e por serem os melhores pais do mundo. Eu dedico este t\\u00edtulo a voc\\u00eas. <\\/span><\\/p>\\r\\n<p style=\\\"text-align: justify;\\\"><span style=\\\"font-size: 14pt;\\\">Obrigada meu pai e minha m\\u00e3e! Sem voc\\u00eas, nada disso seria poss\\u00edvel. Eu amo muito voc\\u00eas!<\\/span><\\/p>\",\"fulltext\":\"\",\"state\":1,\"catid\":\"2\",\"created\":\"2019-10-20 21:45:47\",\"created_by\":\"979\",\"created_by_alias\":\"\",\"modified\":\"2019-10-20 22:08:52\",\"modified_by\":\"979\",\"chec