u00b7 LHD Transportes \\u2013 Betim \\u2013 MG De 2018 \\u00e0 2018. <br \\/> <strong>Cargo:<\\/strong> Auxiliar Administrativo.<br \\/> <strong>Principais atividades:<\\/strong> Ger\\u00eancia de informa\\u00e7\\u00f5es, Revis\\u00e3o de Documentos e Log\\u00edstica de transporte de ve\\u00edculos.<\\/li>\\r\\n<li>\\u00b7 Atacad\\u00e3o SA \\u2013 S\\u00e3o Joaquim de Bicas \\u2013 MG De 2017 a 2018.<br \\/> <strong>Cargo:<\\/strong> Auxiliar de Armazenagem.<br \\/> <strong>Principais atividades:<\\/strong> Armazenamento e separa\\u00e7\\u00e3o de mercadorias, manter estoque e depend\\u00eancias organizados, controlar entrada e sa\\u00edda de materiais.<\\/li>\\r\\n<li>\\u00b7 Atacad\\u00e3o SA \\u2013 S\\u00e3o Joaquim de Bicas \\u2013 MG De 2016 a 2017. <br \\/> <strong>Cargo:<\\/strong> Aprendiz Administrativo.<\\/li>\\r\\n<\\/ul>\\r\\n<p><strong>Principais atividades:<\\/strong> Auxiliar no CPD (Centro de Processamento de dados), Criar Planilhas Para lan\\u00e7amento de informa\\u00e7\\u00e3o, conferir cargas pelo sistema, emitir e separar notas e boletos, e libera\\u00e7\\u00e3o de motoristas.<\\/p>\\r\\n<p><strong>Cursos Complementares:<\\/strong><\\/p>\\r\\n<ul>\\r\\n<li>\\u00b7 Operador de Microcomputadores<\\/li>\\r\\n<li>\\u00b7 Manuten\\u00e7\\u00e3o de Microcomputadores<\\/li>\\r\\n<\\/ul>\\r\\n<ul>\\r\\n<li>\\u00b7 Superior em Sistemas da Informa\\u00e7\\u00e3o - PUC Minas \\u2013 Betim\\/MG -<\\/li>\\r\\n<\\/ul>\\r\\n<p>Em andamento. (5\\u00b0 Per\\u00edodo), Previs\\u00e3o de conclus\\u00e3o em 2021.<\\/p>\\r\\n<ul>\\r\\n<li>\\u00b7 T\\u00e9cnico em Inform\\u00e1tica \\u2013 SENAI \\u2013 CFPEL (Centro De Forma\\u00e7\\u00e3o Profissional Euvaldo Lodi ) - Contagem - Conclu\\u00eddo em (Julho\\/2016).<\\/li>\\r\\n<li>\\u00b7 Ensino M\\u00e9dio Completo - E.E Professora Geralda Eug\\u00eania Da Silva - S\\u00e3o Joaquim de Bicas.<\\/li>\\r\\n<\\/ul>\\r\\n<p><strong>Experi\\u00eancia Profissional:<\\/strong><\\/p>\\r\\n<ul>\\r\\n<li>\\u00b7 LHD Transpor